import React from 'react'

import FormInput from '../component/FormInput'

import { workshopArr, dietaryArr, OccupationArr, heardArr } from '../Data'

const GetTicket = () => {

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = new FormData(e.target);
  }

  return (
    <div className='TicketPage'>
      <form>
        <FormInput name="FirstName" type="input" placeholder="First Name" />
        <FormInput name="LastName" type="input" placeholder="Last Name" />
        <FormInput name="PhoneNumber" type="input" placeholder="Phone Number" />
        <FormInput name="Email" type="input" placeholder="Email" />
        <FormInput name="School" type="input" placeholder="School" />
        <FormInput name="Workshop" type="menu" options={workshopArr} />
        <FormInput name="Dietary" type="menu" options={dietaryArr} />
        <FormInput name="Occupation" type="menu" options={OccupationArr} />
        <FormInput name="Attend" type="yesOrNo" />
        <FormInput name="Heard" type="mutipleChoice" options={heardArr} />
      </form>
    </div>
  )
}

export default GetTicket
